import Head from 'next/head'
import Nav from './Nav'

const Container = (props) => (
    <div>
        <Head>
            <title>Bitcoin Prices</title>
            <link rel="icon" href="https://en.bitcoin.it/w/images/en/6/69/Btc-sans.png"/>
        </Head>
        <Nav />
        {props.children}
    </div>
)

export default Container;
